_da3‍.x([["Library",()=>Library]]);class Library{
  constructor(books = []) {
    this.books = books;
  }

  bookCount() {
    return this.books.length;
  }

  addBook(newBook) {
    this.books.push(newBook);
  }

  addBooks(newBooks) {
    newBooks.forEach(book => this.books.push(book));
  }

  printInventory() {
    this.books.forEach((book) => {
      const {author, title} = book;
      console.log(`${title} by ${author}`);
    });
  }

}

